      name2: "raja",
      hotelname: "xyz",
      plane: "Astrian",
      travelhours: "8",
    },
    {
      id: "el2",
      title: "Bankok",
      date: new Date(2022, 4, 19),
      price: 25,
      days: 3,
      persons: 2,
      name1: "shravan",
      name2: "raja",
      hotelname: "xyz",
      plane: "Air Asia",
      travelhours: "2",
